import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";



export default class Responsive extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: false,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 4,
      initialSlide: 0,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
    return (
      <div>

        <Slider {...settings}>
          <div>
            <div className="box-sli">
              <div className="name-res">
                <span className="mn"> MELIA</span> <br />
                Residence</div>
            </div>
          </div>
          <div>
          <div className="box-sli">
              <div className="name-res">
                <span className="mn"> MELIA</span> <br />
                Residence</div>
            </div>
          </div>
          <div>
          <div className="box-sli">
              <div className="name-res">
                <span className="mn"> MELIA</span> <br />
                Residence</div>
            </div>
          </div>
